import pytest
from todo.models import TODOItem
from todo.serializers import TODOItemSerializer
from django.contrib.auth.models import User
from django.core.files.uploadedfile import SimpleUploadedFile

BASE64_IMAGE = 'data:image/jpeg;base64, \
     \
     \
     \
     \
     \
     \
     \
     \
     \
     \
     \
     \
     \
     \
     \
    '

@pytest.mark.django_db
def test_create_todo_item(auth_client, user):
    response = auth_client.post(
        '/todo/list/',
        {
            'title': 'Cook',
            'description': 'Need to cook pasta for lunch',
            'image': BASE64_IMAGE
        }
    )
    assert response.status_code == 201

@pytest.mark.django_db
def test_retrieve_todo_list(auth_client, user):
    mock_image = SimpleUploadedFile(
        name='test_image.jpg',
        content=b'mock',
        content_type='image/jpeg'
    )
    for item in ['First', 'Second', 'Third']:
        TODOItem.objects.create(
            owner=user,
            title=f'{item} item',
            description=f'{item} description',
            image=mock_image
        )
    another_user = User.objects.create_user(
        username='AnotherGuy',
        password='123'
    )
    TODOItem.objects.create(
        owner=another_user,
        title='Another item',
        description='Another description',
        image=mock_image
    )
    response = auth_client.get('/todo/list/')
    assert response.status_code == 200
    assert len(response.data) == 3

@pytest.mark.django_db
def test_replace_todo_item(auth_client, todo_item):
    assert todo_item.title == 'Work'
    assert todo_item.description == 'Need to do some stuff...'
    response = auth_client.put(
        f'/todo/item/{todo_item.id}/',
        {
            'title': 'Cook',
            'description': 'Need to cook pasta for lunch',
            'image': BASE64_IMAGE
        }
    )
    todo_item.refresh_from_db()
    assert todo_item.title == 'Cook'
    assert todo_item.description == 'Need to cook pasta for lunch'

@pytest.mark.django_db
def test_replace_todo_item_cannot_partial_update(auth_client, todo_item):
    assert todo_item.title == 'Work'
    assert todo_item.description == 'Need to do some stuff...'
    response = auth_client.put(
        f'/todo/item/{todo_item.id}/',
        {'title': 'Cook'}
    )
    assert response.status_code == 400

@pytest.mark.django_db
def test_partial_update_todo_item(auth_client, todo_item):
    assert todo_item.title == 'Work'
    assert todo_item.description == 'Need to do some stuff...'
    response = auth_client.patch(
        f'/todo/item/{todo_item.id}/',
        {'title': 'Cook'}
    )
    todo_item.refresh_from_db()
    assert todo_item.title == 'Cook'
    assert todo_item.description == 'Need to do some stuff...'

@pytest.mark.django_db
def test_delete_todo_item(auth_client, todo_item):
    response = auth_client.delete(f'/todo/item/{todo_item.id}/')
    assert response.status_code == 204

    with pytest.raises(TODOItem.DoesNotExist):
        todo_item.refresh_from_db()